    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1949.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    Resource management is outlined; topics include haying and timber removal. The public
    relations section discusses recreational uses, Refuge visitors, and Refuge participation.
